import React from 'react';
import Footer from '../components/Footer/Footer';
import Header from '../components/Header/Header';
import { 
	Homepage,
	H1,
	HomepageLink,
	ProjectContainer,
	ProjectContent,
	ProjectHeader,
	ProjectTags,
	ProjectDescription
} from './Project.styles';

const InProgress = () => {
    return(
        <div>
			<Homepage>
				<H1 id="logo"><HomepageLink href="index.html">Megan Chong</HomepageLink></H1>
			</Homepage>
			<Header height="15vh"/>
            <section class="project" id="project">
		        <ProjectContainer>
			        <ProjectContent>
				        <ProjectHeader>Media and Design Co-op</ProjectHeader>
					    <ProjectTags>Graphic Design, Web Development</ProjectTags><br/>   
				        <ProjectDescription>Co-oping at Brigham and Women's hospital for Spring 2020 and Summer 1 semester. Stay tuned for updates!</ProjectDescription>
                </ProjectContent>
                    </ProjectContainer>
		    </section>
			<Footer/>
        </div>
    );
}

export default InProgress;
